import styled from 'styled-components';
import homeIcon from '../assets/home.svg';
import mapIcon from '../assets/map.svg';
import myIcon from '../assets/my.svg';
import bgImg from '../assets/background.png';

const NavBarContainer = styled.div`
  width: 100%;
  background: #99cce3;
  display: flex;
  justify-content: space-around;
  align-items: center;
  padding: 24px 0 16px 0;
`;

const NavItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

    const NavIcon = styled.img`
  width: 40px;
  height: 40px;
  margin-bottom: 4px;
  opacity: ${props => props.active ? 1 : 0.5};
  filter: ${props => props.active ? 'none' : 'grayscale(1)'};
`;

const NavText = styled.div`
  color: color(display-p3 0.8565 0.9306 1);
  text-align: center;
  leading-trim: both;
  text-edge: cap;
  font-family: Pretendard;
  font-size: 12px;
  font-style: normal;
  font-weight: 500;
  line-height: 125%;
  text-transform: uppercase;
`;

export default function NavBar() {
  return (
    <NavBarContainer>
      <NavItem>
        <NavIcon src={homeIcon} alt="home" active />
        <NavText active>HOME</NavText>
      </NavItem>
      <NavItem>
        <NavIcon src={mapIcon} alt="map" />
        <NavText>WEATHER MAP</NavText>
      </NavItem>
      <NavItem>
        <NavIcon src={myIcon} alt="my" />
        <NavText>MY</NavText>
      </NavItem>
    </NavBarContainer>
  );
}
